import React from 'react';

function ButtonForm() {
  return (
<label class='login-button'>
 <input type='checkbox'/>
	 <span class='back'>
		<span class='toggle'></span>
 		<span class='label on'>LOGIN</span>
		<span class='label off'>SIGN UP</span>  
	</span>
</label>
  );
}



export default ButtonForm;
